import { DOC_TITLE } from '../lib/constants';
import Link from 'next/link';

const Header = () => {
    return (
        <div id="header">
            <div class="flex bg-white fixed top-0 inset-x-0 z-100 h-20 items-center">
                <div class="w-full max-w-screen-xl relative mx-auto px-6">
                    <Link href="/" class="block text-2xl md:text-4xl font-bold tracking-light md:tracking-lighter leading-tight mb-20 mt-8">
                        <a className="hover:underline">{DOC_TITLE}</a>
                    </Link>
                </div>
            </div>
        </div>
    )
}

export default Header
